      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - ( - 72 ) + - 53 AND - col1 * - col2 * + col0 * col1 + - 77 * - col1 * + - col2;
  - name: tab2

outputs:
  - name: q1066.out
    data: |
